import React from "react";

class UltimoEmprego extends React.Component {
  render() {
    return (
      <fieldset>
        <label>
          Resumo do Curriculo:
          <textarea maxLength="1000" required />
        </label>
        <label>
          Cargo:
          <textarea maxLength="40" onMouseEnter="Preencha com cuidado está informação." required/>
        </label>
        <label>
          Descrição do cargo:
          <text maxLength="500" required/>
        </label>
      </fieldset>
    )
  }
}

export default UltimoEmprego;
